const styles = theme => ({
    formControl: {
      width: '45%',
      background: '#666',
      '& svg': {
        color: '#fff',
        fontSize: 30,
        marginRight: 10
      }
    },
    label: {
        marginLeft: '12%',
        color: '#fff !important'
    },
    calendarImg: {
        position: 'absolute',
        top: '26%',
        left: '4%',
        width: 25,
        height: 25
    },
    inputText: {
        marginLeft: '12%',
        color: '#fff',
        textAlign: 'left',
        backgroundColor: '#666'
    }
});

export default styles;
